package javaSourseCode;

public class LoginSearchInput {

	String maillogin;
	String passlogin;
	public LoginSearchInput(String maillogin, String passlogin) {
		super();
		this.maillogin = maillogin;
		this.passlogin = passlogin;
	}
	public LoginSearchInput() {
		// TODO Auto-generated constructor stub
	}
	
	public String getMaillogin() {
		return maillogin;
	}
	public void setMaillogin(String maillogin) {
		this.maillogin = maillogin;
	}
	public String getPasslogin() {
		return passlogin;
	}
	public void setPasslogin(String passlogin) {
		this.passlogin = passlogin;
	}
	
	
}
